import Student from './mystudents.js';
import Today from "./todaycomponent.js";
import Chat from "./chat.js";
import Metro from './metro.js';
import "../view.css"
class Studentview extends Component {
    constructor(props) {
        //create state
        super(props);
        this.state = {
            
        };
    }
    

    render() {
       

        return (

                <div style={{display:"flex", flexDirection:"column", justifycontent:"center", marginLeft:"40px"}}>
                    <h1 style={{marginTop:"10px"}}>Student dash</h1>
                    <div style={{display:"flex", flexDirection:"row",  }}>
                        <Student handleChange={this.handleChange} statesetter={this.statesetter}/>
                        <Today handleChange={this.handleChange} statesetter={this.statesetter} />
                    </div>
                    <div style={{display:"flex", flexDirection:"row", }}>
                        <Chat handleChange={this.handleChange} statesetter={this.statesetter}/>
                        <Metro handleChange={this.handleChange} statesetter={this.statesetter}/>
                    </div>
                </div>

        );
    }
}

export default Studentview;
